import {TabContext, TabList, TabPanel} from "@mui/lab";
import {Box, Grid} from "@mui/material";
import {useState} from "react";
import Tab from "@mui/material/Tab";
import MasterItemHome from "./masteritemhome";
import MasterItemAdd from "./masteritemadd";

function MSdasboard() {
    const [value, setValue] = useState('1');

    const handleChange = (e: React.SyntheticEvent, newValue: string) => {
        setValue(newValue);
    };


    return (
        <Grid container>
            <Grid item xs={12}>
                <Box sx={{ width: '100%', typography: 'body1' }}>
                    <TabContext value={value}>
                        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                            <TabList onChange={handleChange} aria-label='Tab MasterItem'>
                                <Tab label="MS Dashboard" value="1" />
                                <Tab label="Add" value="2" />
                            </TabList>
                        </Box>
                        <TabPanel value="1">
                            <MasterItemHome />
                        </TabPanel>
                        <TabPanel value="2">
                            <MasterItemAdd />
                        </TabPanel>
                    </TabContext>
                </Box>
            </Grid>
        </Grid>
    )
}

export default MSdasboard;
